import React from "react";
import { ComponentMeta, Story } from "@storybook/react";
import CandelStickChart, { ChartProps } from "./";
import { colors } from "../../theme/colors";

// More on default export: https://storybook.js.org/docs/react/writing-stories/introduction#default-export
export default {
  title: "Charts/Candletick",
  component: CandelStickChart,
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {
    diameter: {
      control: { type: "text" }, // Automatically inferred when 'options' is define
    },
  },
} as ComponentMeta<typeof CandelStickChart>;

// More on component templates: https://storybook.js.org/docs/react/writing-stories/introduction#using-args
const Template: Story<ChartProps> = (args) => <CandelStick {...args} />;

export const CandelStick = Template.bind({});

CandelStick.args = {};



CandelStick.parameters = { storySource: { source: "(args) => <CandelStick {...args} />" }, ...CandelStick.parameters };
